import React from 'react'

const headerStyle = {
    backgroundImage: "url(' + '../img/marblequarry.jpg' + ')",
    backgroundSize: 'cover',
    height: '94vh',
    width: '100%'
}

const Header = () => {

    return (
            <header style={headerStyle}>
                <div class="header__logo">
                    <img src="../img/FP-13.png" alt="Fragment Pur logo" class="logo-black" />
                </div>
            </header>
    )
}

export default Header
